import React, {Component} from 'react'
import {render} from 'react-dom'

import qrCode from 'qrcode.react'

class Demo extends Component {
  render() {
    return <div>
      <qrCode value='https://reactjs.org'/>
    </div>
  }
}

export default qrCode;
